] : يوجد اساسنسير وانتر جماعي يوجد الومتال وباب مصفح بالشقه
[ : 4غرف وثلاث حمامات كلهم علي الشارع ماعدا المطبخ علي منور
] : نصف تشطيب وباب مصفح  الواجهه الومتال وانتر كم وبها اسانسير
: الشقة مميزه جدا
] : لان المبني علي شارعين
[] : انا املك شقتبن  يا ريت لو تسوقي واحده منهم
] : العماره بتعجب العملاء كلهم لانها حلوه جدا بس التوفيق وعدم التوفيق
